import React from 'react';

function Card(props){
    return(
        <div className="card">
        <div className="cards">
            <img src={props.isc} alt="mypic" className="card_img"/>
            <div className="card__info">
                <h3 className="card_titel">{props.titel}</h3>
                <span className="card_txt">{props.txt}</span>
                <a href="#" target="_blank" className="card_btn"><button className="btn">Read More</button></a>
            </div>
        </div>
    </div>
    )
}

export default Card;
